CREATE TABLE Superstore (
  `Category` VARCHAR(1024),
  `City` VARCHAR(1024),
  `Country` VARCHAR(1024),
  `Customer_Name` VARCHAR(1024),
  `Number_of_Records` int,
  `Order_ID` VARCHAR(1024),
  `Manufacturer` VARCHAR(1024),
  `Product_Name` VARCHAR(1024),
  `Profit` int,
  `Quantity` int,
  `Region` VARCHAR(1024),
  `Sales` int,
  `Segment` VARCHAR(1024),
  `Ship_Mode` VARCHAR(1024),
  `State` VARCHAR(1024),
  `Sub_Category` VARCHAR(1024),
  `Order_Date` date,
  `Ship_Date` date);

